jQuery(window).on('elementor/frontend/init elementor/popup/show', function() {
                    var $currentTooltip = '#eael-section-tooltip-5d1bbead';

                    if (typeof tippy !== 'undefined') {
                        tippy($currentTooltip, {
                            content: 'Exploring Underworld!',
                            placement: 'bottom',
                            animation: 'perspective',
                            arrow: '1',
                            arrowType: 'sharp',
                            duration: '300',
                            distance: '10',
                            delay: '100',
                            size: 'large',
                            trigger: 'mouseenter',
                            animateFill: false,
                            flip: true,
                            flipOnUpdate: true,
                            interactive: true,
                            flipBehavior: 'flip',
                            maxWidth: 350,
                            zIndex: 99999,
                            followCursor:  false ,
                            onShow(instance) {
                                var tippyPopper = instance.popper;
                                jQuery(tippyPopper).attr('data-tippy-popper-id', '5d1bbead');
                            }
                        });
                    }
                });

@media (max-width: 767px) {
			   #eael-data-table-wrapper-5d1bbead.custom-responsive-option-enable .eael-data-table thead {
                    display: none;
               }
               #eael-data-table-wrapper-5d1bbead.custom-responsive-option-enable .eael-data-table tbody tr td {
                    float: none;
                    clear: left;
                    width: 100%;
                    text-align: left;
                    display: flex;
                    align-items: center;
                }
			}
